import React from 'react'
import { AppContext } from '../App';
import { useContext } from 'react';
import { useNavigate } from "react-router-dom";

function Home() {
  const {result, pagination, setPagination} = useContext(AppContext)
  const navigate = useNavigate();
  function previous() {
    setPagination((i) => (i -= 1));
    navigate('/babyplanner')
  }
  function next() {
    setPagination((i) => (i += 1));
    navigate('/home')
  }
  return (
    <div>Home
      <div className="buttons">  
          <button onClick={previous} className="btn1">
            Refresh
          </button>
          <button type="submit" className="btn">
            Enter
          </button>
          <button onClick={next} className="btn2">
            Baby
          </button>
          </div>
    </div>
  )
}

export default Home
